MGCAddSnippet(5, "This chapter describes the typographical conventions used in this manual to define Questa SIM command syntax.");
MGCAddSnippet(6, "The following conventions are used to define ModelSim command syntax");
MGCAddSnippet(7, "Several Questa SIM commands have arguments that specify file or directory locations (pathnames). For example, the ‑y argument to the vlog command specifies the Verilog source library directory to search for undefined modules. ");
MGCAddSnippet(8, "Design objects are organized hierarchically, where various objects creates a new level in the hierarchy.");
MGCAddSnippet(9, "To specify object names in Questa SIM, you use the following syntax:");
MGCAddSnippet(10, "Because Questa SIM is based on the Tcl scripting language, you must surround objects and signals with braces ( {} ) when specifying array bits or slices with parentheses ( () ), spaces, or square brackets ( [] ). ");
MGCAddSnippet(11, "You can specify members of SystemC structures and classes using HDL record syntax. ");
MGCAddSnippet(12, "SystemVerilog offers the scope resolution operator, double colon ( :: ), for accessing classes within a package and static data within a class. The example below shows various methods of using this operator as well as alternatives using standard hierarchical references.");
MGCAddSnippet(13, "Questa SIM distinguishes between four  types  of object names: simple, relative, fully-rooted, and absolute.");
MGCAddSnippet(14, "You can substitute environment variables for pathnames in any argument that requires a pathname. ");
MGCAddSnippet(15, "Name case sensitivity is different for VHDL and Verilog. VHDL names are not case-sensitive except for extended identifiers in VHDL 1076-1993 or later. In contrast, all Verilog names are case-sensitive.");
MGCAddSnippet(16, "The following are supported formats for extended identifiers for any command that takes an identifier.");
MGCAddSnippet(17, "You can use wildcard characters in HDL object names in many simulator commands. ");
MGCAddSnippet(18, "There are a number of commands that support wildcard characters.");
MGCAddSnippet(19, "The WildcardFilter preference variable controls which object types are excluded when performing wildcard matches with simulator commands. The WildcardFilter preference variable is a Tcl List and can be modified using Tcl commands. ");
MGCAddSnippet(20, "You can reference Questa SIM variables in a simulator command by preceding the name of the variable with the dollar sign ($) character.");
MGCAddSnippet(21, "You can specify the time unit for delays in all simulator commands that have time arguments.");
MGCAddSnippet(22, "By defining and calling optionsets, you can easily use and combine common command line options.");
MGCAddSnippet(23, "You can load additional arguments into some commands by using argument files, which are specified with the -f argument. ");
MGCAddSnippet(24, "The following shortcut techniques are available on the command line.");
MGCAddSnippet(25, "You can review simulator command history or rerun previous commands by using keyboard shortcuts at the Questa SIM/VSIM prompt.");
MGCAddSnippet(26, "Numbers in Questa SIM can be expressed in either VHDL or Verilog style. You can use two styles for VHDL numbers and one for Verilog. ");
MGCAddSnippet(27, "There are two types of VHDL number styles:");
MGCAddSnippet(28, "Verilog numbers are expressed in the style:");
MGCAddSnippet(29, "The GUI_expression_format is an option of several simulator commands that operate within the Questa SIM GUI environment. The expressions help you locate and examine objects within the List and Wave windows (expressions may also be used through the EditSearch menu in both windows). The commands that use the expression format are:");
MGCAddSnippet(30, "GUI expressions are typed. The supported types consist of the following scalar and array types.");
MGCAddSnippet(31, "GUI expressions generally follow C-language syntax, with both VHDL-specific and Verilog-specific conventions supported. These expressions are not parsed by the Tcl parser, and so do not support general Tcl; parentheses should be used rather than braces. Procedure calls are not supported.");
MGCAddSnippet(32, "Questa SIM supports naming conventions for VHDL and Verilog signal pathnames, VHDL array indexing, Verilog bit selection, VHDL subrange specification, and Verilog part selection.");
MGCAddSnippet(33, "Operator precedence generally follows that of the C language, but liberal use of parentheses is recommended.");
MGCAddSnippet(34, "Elements in the concatenation that are arrays are expanded so that each element in the array becomes a top-level element of the concatenation. But for elements in the concatenation that are records, the entire record becomes one top-level element in the result. ");
MGCAddSnippet(35, "Arbitrarily-nested arrays and records are supported, but operators will only operate on one field at a time. That is, the expression {a == b} where a and b are records with multiple fields, is not supported. ");
MGCAddSnippet(36, "When you use the GUI to search for signal values displayed in 4-state binary radix, you should be aware of how Questa SIM maps between binary radix and std_logic. The issue arises because there is no  un-initialized  value in binary, while there is in std_logic. So, Questa SIM relies on mapping tables to determine whether a match occurs between the displayed binary signal value and the underlying std_logic value.");
MGCAddSnippet(37, "This chapter describes Questa SIM commands, listed alphabetically from A through M, that you can enter either on the command line of the Main window or in a DO file. Some commands are automatically entered on the command line when you use the graphical user interface. ");
MGCAddSnippet(38, "Clears the Main window Transcript window.");
MGCAddSnippet(39, "Halts the execution of a DO file interrupted by a breakpoint or error. When DO files are nested, you can choose to abort the last DO file script only, to abort a specified number of nesting levels, or to abort all DO files. You can specify this command within a DO file to return early.");
MGCAddSnippet(40, "Opens an Assertion Thread View (ATV) window for the specified assert or cover directive (designated by its pathname), at the specified evaluation attempt start time. Arguments to this command are order-dependent. ");
MGCAddSnippet(41, "Adds a user-defined button to the Main window button bar. New buttons appear on the right side of the Standard toolbar.");
MGCAddSnippet(42, "Adds the specified process, signal, net, or register to the Dataflow window. Wildcards are allowed. ");
MGCAddSnippet(43, "Adds objects and their values to the List window.");
MGCAddSnippet(44, "Displays the contents and sets the address and data radix of the specified memory in the MDI frame of the Main window.  Refer to  Wildcard Characters  for wildcard usage as it pertains to the add commands.");
MGCAddSnippet(45, "Used within a DO file or script to specify a user-defined runtime message to be sent to the transcript and .wlf files. Messages are displayed in the Message Viewer window in the GUI. Refer to the GUI Reference Manual for more information on this window. ");
MGCAddSnippet(46, "Adds the specified process, signal, net, or register to the Incremental or Full view of the Schematic window. Wildcards are allowed. ");
MGCAddSnippet(47, "Adds .ucdb file(s) to the test management browser. ");
MGCAddSnippet(48, "Adds signals and variables to the Watch window in the Main window. SystemC objects and user‑defined buses may also be added.  Refer to  Wildcard Characters  for wildcard usage as it pertains to the add commands.");
MGCAddSnippet(49, "Adds objects to the Wave window. ");
MGCAddSnippet(50, "Adds the specified command name, description, and command arguments to the command-line help. You can then access the information using the help command. ");
MGCAddSnippet(51, "Adds a menu to the menu bar of the specified window, using the specified menu name. Use the add_menuitem, add_separator, add_menucb, and add_submenu commands to complete the menu.  Returns the full Tk pathname of the new menu.  You can change color and other Tk properties of the menu, after creation, with the Tk menu widget configure command. ");
MGCAddSnippet(52, "Creates a checkbox within the specified menu of the specified window. A checkbox is a small box with a label. Clicking on the box toggles the state from on to off, or off to on.  When the box is  on , the Tcl global variable <var> is set to <onval>. When the box is  off , the global variable is set to <offval>. If any operation changes the global variable, the state of the checkbox also changes. Returns nothing.");
MGCAddSnippet(53, "Creates a menu item within the specified menu or submenu of the specified window. Returns nothing.");
MGCAddSnippet(54, "Adds a separator as the next item in the specified menu path in the specified window.  Returns nothing.");
MGCAddSnippet(55, "Creates a cascading submenu within the specified menu path of the specified window. Can be used within a submenu.  Returns the full Tk path to the new submenu widget.");
MGCAddSnippet(56, "Displays or creates user-defined aliases. Any arguments passed on invocation of the alias are passed through to the specified commands.  Returns nothing. Existing commands (for example, run, env, and so forth) cannot be aliased.");
MGCAddSnippet(57, "Enables you to load an archived debug database (.dbar) file that was previously created with the archive write command. The archived file may include a number of WLF files, design source files, and a DBG file.");
MGCAddSnippet(58, "Enables you to create a debug archive file, with the file extension .dbar, that contains one or more WLF files, debug information captured from the design library, an optional connectivity debug database file, and optional HDL source files. You can use this archived file to perform post-simulation debugging in a location that differs from where the original simulation was run.");
MGCAddSnippet(59, "Enables you to set the assertion action for concurrent assertion starts, failures, passes, and antecedent matches. ");
MGCAddSnippet(60, "Instructs the simulator to report on any active assertion directives at the end of simulation (EOS). Active assertion directives are then indicated in the Assertions tab of the Analysis window, with the text  active at end of simulation  in the EOS Note column. If the PSL assert directive is strong, the EOS Note column reports both the usual  active at end of simulation  note and a PSL strong error message. ");
MGCAddSnippet(61, "Returns the sum of the assertion failure counts for the specified set of assertion directive instances. Returns a  No matches  warning if the given path does not contain any assertions.");
MGCAddSnippet(62, "Enables and disables assertions and cover directives. ");
MGCAddSnippet(63, "This command configures simulator behavior in response to a SystemVerilog or PSL assertion failure. ");
MGCAddSnippet(64, "Configures simulator behavior in response to a SystemVerilog or PSL assertion pass. ");
MGCAddSnippet(65, "Generates a fine grained profile of memory usage for assertions and cover directives, including: current memory used, peak memory used (as well as the simulation run time at which it peaked), and the cumulative thread count for the assertion or cover directive. ");
MGCAddSnippet(66, "Generates a status report for each SystemVerilog or PSL assertion matching the path specification. ");
MGCAddSnippet(67, "Enables or disables assertion thread viewing (ATV) for the specified assertion or assertions. Specify multiple assertions by their pathnames. ");
MGCAddSnippet(68, "Returns  1  if Questa SIM is operating in batch mode, otherwise it returns  0.  Typically used as a condition in an if statement. ");
MGCAddSnippet(69, "Deletes a breakpoint. You can delete multiple breakpoints by specifying separate information groupings on the same command line. ");
MGCAddSnippet(70, "Creates a named reference to a specific zoom range and scroll position in the specified Wave window. Bookmarks are saved in the wave format file and are restored when the format file is read. ");
MGCAddSnippet(71, "This command deletes bookmarks from the specified Wave window. ");
MGCAddSnippet(72, "Zooms and scrolls a Wave window using the specified bookmark. ");
MGCAddSnippet(73, "Displays a list of available bookmarks in the Transcript window. ");
MGCAddSnippet(74, "Either sets a file-line breakpoint, or returns information about breakpoint(s). Allows condition expressions to use enum names, as well as literal values.");
MGCAddSnippet(75, "Calls SystemVerilog static functions and class functions (but not tasks) from the vsim command line in live simulation mode. Calls PLI and VPI system tasks and system functions. Returns function return values to the vsim shell as a Tcl string. Returns class references as class instance IDs. ");
MGCAddSnippet(76, "Generates detailed reports and databases to capture simulation memory use in your design.");
MGCAddSnippet(77, "Changes the Questa SIM local directory to the specified directory. ");
MGCAddSnippet(78, "This command provides command-line equivalents of the menu options that are available for C Debug. ");
MGCAddSnippet(79, "This command modifies the value of a: VHDL constant, generic, or variable; Verilog register or variable; or C variable if running C Debug.");
MGCAddSnippet(80, "Changes the command executed by a specified menu item label, in a specified menu, in a specified window. Returns nothing.");
MGCAddSnippet(81, "Enables contention checking on the specified nodes. Allowed nodes are Verilog nets and VHDL signals of types std_logic and std_logic_vector. Ignores any other node types, and nodes that do not have multiple drivers.");
MGCAddSnippet(82, "Allows you to write checking messages to a file. By default, any messages display on your screen. Also allows you to configure the contention time limit.");
MGCAddSnippet(83, "Disables contention checking for the specified nodes. ");
MGCAddSnippet(84, "Enables float checking for the specified nodes. ");
MGCAddSnippet(85, "Enables you to write checking messages to a file (messages display on your screen by default). Also enables you to configure the float time limit. ");
MGCAddSnippet(86, "Disables float checking for the specified nodes. ");
MGCAddSnippet(87, "Disables stability checking. Clock cycle numbers and boundaries are still tracked, and you can later re-enable stability checking with check stable on.");
MGCAddSnippet(88, "Enables stability checking on the entire design. ");
MGCAddSnippet(89, "Saves the state of your simulation as a checkpoint file that you can restore. ");
MGCAddSnippet(90, "Returns class inheritance hierarchy for a named class type. ");
MGCAddSnippet(91, "Returns the descriptive class name for the specified authoritative class name. ");
MGCAddSnippet(92, "Reports on the current state of a specified class instance; whether it exists, has not yet been created, or has been destroyed.");
MGCAddSnippet(93, "Displays a list of the classes which implement a specified SystemVerilog interface class. The type of the class argument affects the contents of the list. ");
MGCAddSnippet(94, "Reports the list of existing class instances of a specific class type. You can use this to determine the class instances to log or examine, and to debug excessive memory use problems caused by class instances that are not cleaned up properly.");
MGCAddSnippet(95, "Lists the interface class types that match a specified pattern. Finds all interface classes that match a regular expression and determines the full path of interface class types. ");
MGCAddSnippet(96, "Returns to the transcript a list of all classes extended from the specified class type.");
MGCAddSnippet(97, "Prints detailed reports on class instance usage. Displays columns for class type names and their current, peak and total class instance counts.");
MGCAddSnippet(98, "Prints statistics about the total number of class types and total, peak, and current class instance counts during the simulation.");
MGCAddSnippet(99, "Displays the active references to the specified class instance. Useful in debugging situations where class instances are not being destroyed as expected because something in the design is still referencing them. Finding those references can lead to uncovering bugs in class reference management, and lead to large memory savings.");
MGCAddSnippet(100, "Lists the class types that match or do not match a specified pattern. Finds all classes that match a regular expression and determines the full path of class types.");
MGCAddSnippet(101, "Creates an object that is a comparison of signals in a reference design to signals in a test design. You can specify whether to compare two signals, all signals in the region, just ports or a subset of ports. Ignores constant signals such as parameters and generics. ");
MGCAddSnippet(102, "Either flags a comparison difference as ignore, or adds a text string annotation to the difference. The text string appears when viewing the comparison difference in info popups or in the output of a compare info command. ");
MGCAddSnippet(103, "Defines a clock to use for clocked-mode comparisons. In clocked‑mode comparisons, signals are sampled and compared at or just after a specified signal edge. ");
MGCAddSnippet(104, "Modifies options for compare signals and regions. Applies the modified options to all objects in the specified compare path. ");
MGCAddSnippet(105, "Continues comparison difference computations that were suspended with the compare stop button or Control-C. If the comparison was not suspended, compare continue has no effect. ");
MGCAddSnippet(106, "Deletes a comparison object from the currently open comparison. ");
MGCAddSnippet(107, "Closes the active comparison without saving any information. ");
MGCAddSnippet(108, "Lists the results of the comparison in the Main window transcript. Includes a -write argument to save the information to a file. ");
MGCAddSnippet(109, "Displays a list in the Transcript window of all the compare add commands currently in effect. ");
MGCAddSnippet(110, "Sets defaults for various waveform comparison commands. The defaults are used when other compare commands are invoked during the current session.");
MGCAddSnippet(111, "Reloads comparison differences for viewing without re-computation. ");
MGCAddSnippet(112, "Clears the current compare differences, allowing execution of another compare run command. Does not modify any of the compare options or any of the signals selected for comparison. This enables you to re-run the comparison with different options or with a modified signal list. ");
MGCAddSnippet(113, "Runs the difference computation on signals you select via a compare add command. Reports in the Transcript window the total number of errors found. ");
MGCAddSnippet(114, "Saves the comparison results to a file for later reloading.");
MGCAddSnippet(115, "Saves the comparison setup information (or  rules ) to a file you can re-execute later. Saves compare options, clock definitions, and region and signal selections. ");
MGCAddSnippet(116, "Displays the specified comparison difference in the Wave window, using any necessary horizontal and vertical scrolling. Highlights the signal containing the specified difference, and positions the active cursor at the starting time of the difference. ");
MGCAddSnippet(117, "Begins a new dataset comparison. The datasets to compare must already be open. ");
MGCAddSnippet(118, "Used internally by the compare stop button to suspend comparison computations in progress. ");
MGCAddSnippet(119, "Primarily used internally to update the comparison differences when comparing a live simulation against a .wlf file.");
MGCAddSnippet(120, "Invokes the List or Wave widget configure command for the current default List or Wave window. ");
MGCAddSnippet(121, "Provides operations to return information, and in some cases manipulate, a context's name. The argument you specify determines the operation.");
MGCAddSnippet(122, "Displays test information based on a merged UCDB created by a vcover merge operation. ");
MGCAddSnippet(123, "Used to display, set, or delete object, test, and UCDB attributes in the currently loaded database.");
MGCAddSnippet(124, "Clears specified types of coverage data from the coverage database.");
MGCAddSnippet(125, "This command configures the two-step exclusion setting.");
MGCAddSnippet(126, "Creates covergroups, coverpoints, crosses and bins under a specified parent in an existing UCDB file. ");
MGCAddSnippet(127, "Opens a coverage dataset (.ucdb) to edit the contents. Used only in Coverage View mode (vsim -viewcov...). Use this command to alter existing UCDBs. ");
MGCAddSnippet(128, "Enables you to exclude items from coverage statistics. ");
MGCAddSnippet(129, "Sets or displays the values for goals that affect bins, coverage items and specific scopes in the design hierarchy.");
MGCAddSnippet(130, "Loads test associated data in preparation for using any test association procedures.");
MGCAddSnippet(131, "Opens UCDB datasets for viewing in the GUI in Coverage View mode. ");
MGCAddSnippet(132, "Ranks coverage data contained in the current Coverage View dataset loaded with vsim -viewcov, according to each individual test s contribution to cumulative coverage. ");
MGCAddSnippet(133, "Produces textual or HTML output of coverage statistics or exclusions. ");
MGCAddSnippet(134, "Saves the coverage results of the specified type from a simulation to the unified coverage database (UCDB). If no type is specified, saves all types into the database. ");
MGCAddSnippet(135, "Creates (or deletes) links (tags) between objects in a coverage database to specific coverage objects in a testplan. A tag is a simple string associated with the object, and objects sharing the same tag name are linked together. ");
MGCAddSnippet(136, "The coverage testnames command displays the testnames in the UCDB file currently loaded into memory. If a merged file is currently loaded, the command gives you a list of tests in the merged file. ");
MGCAddSnippet(137, "Reports on objects that are  unlinked,  for test traceability purposes.");
MGCAddSnippet(138, "Sets or displays weights for global or individual items in the design.");
MGCAddSnippet(139, "Maps an alternate name (alias) to an open dataset. ");
MGCAddSnippet(140, "Removes all event data from the current simulation WLF file, while retaining all currently logged signals. Subsequent run commands continue to accumulate data in the WLF file.");
MGCAddSnippet(141, "Closes an active dataset.");
MGCAddSnippet(142, "Configures WLF parameters for an open dataset and all aliases mapped to that dataset.");
MGCAddSnippet(143, "Activates the specified dataset and sets the GUI context to the last selected context of the specified dataset. All context dependent GUI data is updated and all context dependent CLI commands start working with respect to the new context. ");
MGCAddSnippet(144, "Reports a variety of information about a dataset.");
MGCAddSnippet(145, "Lists all active datasets. ");
MGCAddSnippet(146, "Opens a WLF file (either the currently running vsim.wlf or a saved WLF file) and/or UCDB file (representing coverage data), and assigns it the logical name you specify.");
MGCAddSnippet(147, "Changes the name of a dataset to the new name you specify.");
MGCAddSnippet(148, "Unloads the specified dataset or currently active dataset and reloads the dataset using the same dataset name. ");
MGCAddSnippet(149, "Writes data from the current simulation to a specified file while the simulation is in progress.");
MGCAddSnippet(150, "Saves data from the current WLF file (vsim.wlf by default) at a specified interval. Provides you with sequential or cumulative  snapshots  of your simulation data. ");
MGCAddSnippet(151, "Removes objects from either the List or Wave window.");
MGCAddSnippet(152, "Displays information about simulation objects and design regions in the Transcript window.");
MGCAddSnippet(153, "Turns off breakpoints and when commands.");
MGCAddSnippet(154, "Disables the specified menu within the specified window, making it inactive (grayed-out). ");
MGCAddSnippet(155, "Disables a specified menu item within the specified menu path of the specified window. The menu item becomes inactive (grayed‑out). ");
MGCAddSnippet(156, "Executes the commands contained in a DO file. ");
MGCAddSnippet(157, "Searches for object transitions or values in the specified List window. ");
MGCAddSnippet(158, "Displays the names and strength of all drivers of the specified object. ");
MGCAddSnippet(159, "Dumps the contents of the specified WLF file to stdout in a readable format. ");
MGCAddSnippet(160, "Displays a specified message in the Transcript window. ");
MGCAddSnippet(161, "Invokes the editor specified by the EDITOR environment variable. By default, the specified filename opens in the Source window. ");
MGCAddSnippet(162, "Turns on breakpoints and when commands that were previously disabled. ");
MGCAddSnippet(163, "Enables a previously disabled menu, changing it from grayed-out to normal and responsive.");
MGCAddSnippet(164, "Enables a previously disabled menu item, changing it from grayed-out to normal and responsive.");
MGCAddSnippet(165, "Translates between the 16-bit Unicode characters used in Tcl strings and a named encoding, such as Shift-JIS. Consists of several related commands.");
MGCAddSnippet(166, "Allows you to display or change the current dataset and region/signal environment. ");
MGCAddSnippet(167, "Examines one or more objects and displays current values (or the values at a specified previous time) in the Transcript window. ");
MGCAddSnippet(168, "Exits the simulator and the Questa SIM application. ");
MGCAddSnippet(169, "Enables, disables, and sets coverage targets for SystemVerilog and PSL cover directives. ");
MGCAddSnippet(170, "Locates objects by type and name.");
MGCAddSnippet(171, "Returns the set of nets that are electrically equivalent to a specified net. Available only during a live simulation.");
MGCAddSnippet(172, "Traces backward in time to find the active driver(s), processes, or first elements of the specified signal or signal event.");
MGCAddSnippet(173, "Searches for a string in the specified file(s) and prints the results to the Transcript window. The results have individual hotlinks that will open the file and display the location of the string.");
MGCAddSnippet(174, "Searches for a string in the source files for the current design and prints the results to the Transcript window, with individual hotlinks to open the source and display the location of the string.");
MGCAddSnippet(175, "Enables you to apply stimulus interactively to VHDL signals, Verilog nets and registers, and SystemC boundary types. ");
MGCAddSnippet(176, "Provides global format control for all time values displayed in the GUI. When specified without arguments, returns the current state of the three arguments.");
MGCAddSnippet(177, "Returns information about recognized finite state machines, including the number of states and transitions. The output matches that of the FSM List window.");
MGCAddSnippet(178, "Returns information about the specified finite state machine. This information matches that found in the FSM Properties dialog box.");
MGCAddSnippet(179, "Displays the specified finite state machine in the FSM List window.");
MGCAddSnippet(180, "Specifies when to run the System Verilog garbage collector. Returns the current settings when specified without arguments. ");
MGCAddSnippet(181, "Runs the SystemVerilog garbage collector.");
MGCAddSnippet(182, "Sets the source directory search path for the C debugger and starts the C debugger, if it is not already running.");
MGCAddSnippet(183, "Gets the time of the active cursor in the Wave window and returns the time value.");
MGCAddSnippet(184, "Gets the time of the active marker in the List window. Returns the time value. If -delta is specified, returns time and delta.");
MGCAddSnippet(185, "Displays a brief description and syntax for the specified command in the Transcript window. ");
MGCAddSnippet(186, "Lists the commands you have executed during the current session. History is a Tcl command. For more information, consult the Tcl Man Pages (Help > Tcl Man Pages). ");
MGCAddSnippet(187, "Controls JobSpy, a tool for monitoring and controlling batch simulations and simulation farms.");
MGCAddSnippet(188, "Enables you to perform a number of editing operations on custom GUI layouts, such as loading, saving, maximizing, and deleting. ");
MGCAddSnippet(189, "Takes one or more Tcl lists as arguments and pretty-prints them to the Transcript window. ");
MGCAddSnippet(190, "Searches left (previous) for signal transitions or values in the specified Wave window. ");
MGCAddSnippet(191, "Creates a wave log format (WLF) or qwavedb file containing simulation data for all HDL objects whose names match the provided specifications.");
MGCAddSnippet(192, "Takes a Tcl list as an argument, and shifts it one place to the left, eliminating the left-most element.");
MGCAddSnippet(193, "Returns a sublist of the specified Tcl list that matches the specified Tcl glob pattern.");
MGCAddSnippet(194, "Compares a selected memory to a reference memory or file.");
